description:
This is obviously a VERY SMALL preview as this collection contains 1709 sets each with an average of 20-30 pictures.


I have packed in one torrent the 10 different torrents I obtained from the russian board (membership required plus a minimum upload ratio_ I have made no other modification except zipping the files because of the very large number of individual pictures included.


There are sets here for all tastes, I really mean that!



